import React, { Component } from "react";
import Button from "react-bootstrap/es/Button";
import { withRouter } from "react-router-dom";

export class Paste extends Component {
  constructor(props) {
    super(props);
    this.state = {
      spd_paste: ""
    };
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleSPDChange = this.handleSPDChange.bind(this);
  }

  handleSPDChange = event => {
    this.setState({ spd_paste: event.target.value });
  };
  handleSubmit(event) {
    console.log(this.state.spd_paste);
  }
  render() {
    return (
      <div>
        <h2>Option C</h2>
        <form>
          <div style={{ position: "inherit", display: "inline-block" }}>
            <label>
              Start Wavelength (nm):
              <br />
              <input></input>
            </label>
            <br />
            <label>
              End Wavelength (nm):
              <br />
              <input></input>
            </label>
            <br />
            <label>
              Interval (nm):
              <br />
              <input></input>
            </label>
          </div>
          <div
            style={{
              position: "inherit",
              display: "inline-block",
              width: "5%"
            }}
          ></div>
          <div style={{ position: "inherit", display: "inline-block" }}>
            <h3>Paste in your SPD</h3>
            <textarea
              rows="5"
              cols="50"
              onChange={this.handleSPDChange}
            ></textarea>
          </div>
          <br />
          <Button bsSize="sm" type="submit">
            Calculate
          </Button>
        </form>
      </div>
    );
  }
}

export default withRouter(Paste);
